import {BrowserRouter, Route, Routes} from "react-router-dom";

function App() {
  return (
      <BrowserRouter>
          <Header></Header>
          <Routes>
              <Route path={""}></Route>
          </Routes>
          <Footer></Footer>
      </BrowserRouter>
  );
}

export default App;
